--
-- Table structure for table `letter`
--

DROP TABLE IF EXISTS `letter`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `letter` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'primary key identifier',
  `module` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT 'Koha module that triggers this notice or slip',
  `code` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT 'unique identifier for this notice or slip',
  `branchcode` varchar(10) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT 'the branch this notice or slip is used at (branches.branchcode)',
  `name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT 'plain text name for this notice or slip',
  `is_html` tinyint(1) DEFAULT 0 COMMENT 'does this notice or slip use HTML (1 for yes, 0 for no)',
  `title` varchar(200) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT 'subject line of the notice',
  `content` mediumtext COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'body text for the notice or slip',
  `message_transport_type` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'email' COMMENT 'transport type for this notice',
  `lang` varchar(25) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'default' COMMENT 'lang of the notice',
  `updated_on` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'last modification',
  PRIMARY KEY (`id`),
  UNIQUE KEY `letter_uniq_1` (`module`,`code`,`branchcode`,`message_transport_type`,`lang`),
  KEY `message_transport_type_fk` (`message_transport_type`),
  CONSTRAINT `message_transport_type_fk` FOREIGN KEY (`message_transport_type`) REFERENCES `message_transport_types` (`message_transport_type`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=70 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

--
-- Dumping data for table `letter`
--

LOCK TABLES `letter` WRITE;
/*!40000 ALTER TABLE `letter` DISABLE KEYS */;
INSERT INTO `letter` VALUES (1,'acquisition','ACQ_NOTIF_ON_RECEIV','','Notification on receiving',0,'Order received','Dear <<borrowers.firstname>> <<borrowers.surname>>,\r\n\r\n Bestllningen <<aqorders.ordernumber>> (<<biblio.title>>) har tagits emot.\r\n\r\nYour library.','email','default','2022-08-30 15:08:00'),(2,'circulation','ACCOUNT_CREDIT','','Din betalning',1,'Din betalning','[% USE Price %]\r\n[% PROCESS \'accounts.inc\' %]\r\n<table>\r\n[% IF ( LibraryName ) %]\r\n <tr>\r\n    <th colspan=\"5\" class=\"centerednames\">\r\n        <h3>[% LibraryName | html %]</h3>\r\n    </th>\r\n </tr>\r\n[% END %]\r\n <tr>\r\n    <th colspan=\"5\" class=\"centerednames\">\r\n        <h2><u>Fee receipt</u></h2>\r\n    </th>\r\n </tr>\r\n <tr>\r\n    <th colspan=\"5\" class=\"centerednames\">\r\n        <h2>[% Branches.GetName( credit.patron.branchcode ) | html %]</h2>\r\n    </th>\r\n </tr>\r\n <tr>\r\n    <th colspan=\"5\">\r\n        Mottagen med tack frn  [% credit.patron.firstname | html %] [% credit.patron.surname | html %] <br />\r\n        Kortnummer: [% credit.patron.cardnumber | html %]<br />\r\n    </th>\r\n </tr>\r\n  <tr>\r\n    <th>Created</th>\r\n    <th>Updated</th>\r\n    <th>Description of charges</th>\r\n    <th>Note</th>\r\n    <th>Amount</th>\r\n </tr>\r\n\r\n <tr class=\"highlight\">\r\n    <td>[% credit.date | $KohaDates %]</td>\r\n    <td>[% credit.timestamp | $KohaDates with_hours = 1 %]</td>\r\n    <td>\r\n      [% PROCESS account_type_description account=credit %]\r\n      [%- IF credit.description %], [% credit.description | html %][% END %]\r\n    </td>\r\n    <td>[% credit.note | html %]</td>\r\n    <td class=\"credit\">[% credit.amount | $Price %]</td>\r\n </tr>\r\n\r\n[% IF ( tendered ) %]\r\n  <tr>\r\n    <td colspan=\"3\">Amount tendered: </td>\r\n    <td>[% tendered | $Price %]</td>\r\n  </tr>\r\n  <tr>\r\n    <td colspan=\"3\">Change given: </td>\r\n    <td>[% change | $Price %]</td>\r\n  </tr>\r\n[% END %]\r\n\r\n<tfoot>\r\n  <tr>\r\n    <td colspan=\"4\">Total outstanding dues as on date: </td>\r\n    [% IF ( credit.patron.account.balance >= 0 ) %]<td class=\"credit\">[% ELSE %]<td class=\"debit\">[% END %][% credit.patron.account.balance | $Price %]</td>\r\n  </tr>\r\n</tfoot>\r\n</table>','print','default','2022-08-30 15:08:00'),(3,'circulation','ACCOUNT_DEBIT','','Account fee',1,'Account fee','[% USE Price %]\r\n[% PROCESS \'accounts.inc\' %]\r\n<table>\r\n  [% IF ( LibraryName ) %]\r\n    <tr>\r\n      <th colspan=\"6\" class=\"centerednames\">\r\n        <h3>[% LibraryName | html %]</h3>\r\n      </th>\r\n    </tr>\r\n  [% END %]\r\n\r\n  <tr>\r\n    <th colspan=\"6\" class=\"centerednames\">\r\n      <h2><u>INVOICE</u></h2>\r\n    </th>\r\n  </tr>\r\n  <tr>\r\n    <th colspan=\"6\" class=\"centerednames\">\r\n      <h2>[% Branches.GetName( debit.patron.branchcode ) | html %]</h2>\r\n    </th>\r\n  </tr>\r\n  <tr>\r\n    <th colspan=\"6\" >\r\n      Bill to: [% debit.patron.firstname | html %] [% debit.patron.surname | html %] <br />\r\n      Kortnummer: [% debit.patron.cardnumber | html %]<br />\r\n    </th>\r\n  </tr>\r\n  <tr>\r\n    <th>Created</th>\r\n    <th>Updated</th>\r\n    <th>Description of charges</th>\r\n    <th>Note</th>\r\n    <th style=\"text-align:right;\">Amount</th>\r\n    <th style=\"text-align:right;\">Amount outstanding</th>\r\n  </tr>\r\n\r\n  <tr class=\"highlight\">\r\n    <td>[% debit.date | $KohaDates%]</td>\r\n    <td>[% debit.timestamp | $KohaDates with_hours = 1 %]</td>\r\n    <td>\r\n      [% PROCESS account_type_description account=debit %]\r\n      [%- IF debit.description %], [% debit.description | html %][% END %]\r\n    </td>\r\n    <td>[% debit.note | html %]</td>\r\n    <td class=\"debit\">[% debit.amount | $Price %]</td>\r\n    <td class=\"debit\">[% debit.amountoutstanding | $Price %]</td>\r\n  </tr>\r\n\r\n  <tfoot>\r\n    <tr>\r\n      <td colspan=\"5\">Total outstanding dues as on date: </td>\r\n      [% IF ( totalcredit ) %]<td class=\"credit\">[% ELSE %]<td class=\"debit\">[% END %][% total | $Price %]</td>\r\n    </tr>\r\n  </tfoot>\r\n</table>','print','default','2022-08-30 15:08:00'),(4,'circulation','ACCOUNT_PAYMENT','','Din betalning',0,'Din betalning','[%- USE Price -%]\r\nEn betalning p [% credit.amount * -1 | $Price %] har gjorts p ditt konto.\r\n\r\nThis payment affected the following fees:\r\n[%- FOREACH o IN offsets %]\r\nBeskrivning: [% o.debit.description %]\r\nBetalt belopp: [% o.amount * -1 | $Price %]\r\nAmount remaining: [% o.debit.amountoutstanding | $Price %]\r\n[% END %]','email','default','2022-08-30 15:08:00'),(5,'circulation','ACCOUNT_WRITEOFF','','Account writeoff',0,'Account writeoff','[%- USE Price -%]\r\nAn account writeoff of [% credit.amount * -1 | $Price %] has been applied to your account.\r\n\r\nThis writeoff affected the following fees:\r\n[%- FOREACH o IN offsets %]\r\nBeskrivning: [% o.debit.description %]\r\nBetalt belopp: [% o.amount * -1 | $Price %]\r\nAmount remaining: [% o.debit.amountoutstanding | $Price %]\r\n[% END %]','email','default','2022-08-30 15:08:00'),(6,'circulation','AR_CANCELED','','Article request - canceled',0,'Article request canceled','Dear <<borrowers.firstname>> <<borrowers.surname>> (<<borrowers.cardnumber>>),\r\n\r\nYour request for an article from <<biblio.title>> (<<items.barcode>>) has been canceled for the following reason:\r\n\r\n<<reason>>\r\n\r\nArticle requested:\r\nTitel: <<article_requests.title>>\r\nFrfattare: <<article_requests.author>>\r\nVolym: <<article_requests.volume>>\r\nNummer: <<article_requests.issue>>\r\nDatum: <<article_requests.date>>\r\nTOC: [% IF article_request.toc_request %]Yes[% ELSE %]No[% END %]\r\nPages: <<article_requests.pages>>\r\nKapitel: <<article_requests.chapters>>\r\nKommentarer: <<article_requests.patron_notes>>\r\nFormat: [% IF article_request.format == \'PHOTOCOPY\' %]Copy[% ELSIF article_request.format == \'SCAN\' %]Scan[% END %]\r\n\r\nYour library','email','default','2022-08-30 15:08:00'),(7,'circulation','AR_COMPLETED','','Article request - completed',0,'Article request completed','Dear <<borrowers.firstname>> <<borrowers.surname>> (<<borrowers.cardnumber>>),\r\n\r\nWe have completed your request for an article from <<biblio.title>> (<<items.barcode>>).\r\n\r\nArticle requested:\r\nTitel: <<article_requests.title>>\r\nFrfattare: <<article_requests.author>>\r\nVolym: <<article_requests.volume>>\r\nNummer: <<article_requests.issue>>\r\nDatum: <<article_requests.date>>\r\nTOC: [% IF article_request.toc_request %]Yes[% ELSE %]No[% END %]\r\nPages: <<article_requests.pages>>\r\nKapitel: <<article_requests.chapters>>\r\nKommentarer: <<article_requests.patron_notes>>\r\nFormat: [% IF article_request.format == \'PHOTOCOPY\' %]Copy[% ELSIF article_request.format == \'SCAN\' %]Scan[% END %]\r\n\r\n[% IF article_request.format == \'PHOTOCOPY\' %]You may pick up your article at [% branch.branchname %].[% ELSIF article_request.format == \'SCAN\' %]You can download the scanned materials via the following url(s): [% article_request.urls %].[% END %]\r\n\r\nTack! ','email','default','2022-08-30 15:08:00'),(8,'circulation','AR_PENDING','','Article request - pending',0,'Pending article request','Dear <<borrowers.firstname>> <<borrowers.surname>> (<<borrowers.cardnumber>>)\r\n\r\nYour request for an article from <<biblio.title>> (<<items.barcode>>) is now in pending state.\r\n\r\nArticle requested:\r\nTitel: <<article_requests.title>>\r\nFrfattare: <<article_requests.author>>\r\nVolym: <<article_requests.volume>>\r\nNummer: <<article_requests.issue>>\r\nDatum: <<article_requests.date>>\r\nTOC: [% IF article_request.toc_request %]Yes[% ELSE %]No[% END %]\r\nPages: <<article_requests.pages>>\r\nKapitel: <<article_requests.chapters>>\r\nKommentarer: <<article_requests.patron_notes>>\r\n\r\n\r\nTack! ','email','default','2022-08-30 15:08:00'),(9,'circulation','AR_REQUESTED','','Article request - new',0,'Article request received','Dear <<borrowers.firstname>> <<borrowers.surname>> (<<b