\r\n\r\n<<branches.branchname>>','email','default','2022-08-30 15:08:00'),(40,'members','OPAC_REG_VERIFY','','OPAC self-registration verification email',1,'Verify your account','Hello!\r\n\r\nYour library account has been created. Please verify your email address by clicking this link to complete the signup process:\r\n\r\n<<OPACBaseURL>>/cgi-bin/koha/opac-registration-verify.pl?token=<<borrower_modifications.verification_token>>\r\n\r\nIf you did not initiate this request, you may safely ignore this one-time message. The request will expire shortly.','email','default','2022-08-30 15:08:00'),(41,'members','PASSWORD_RESET','','Online password reset',1,'Koha password recovery','<html>\r\n<p>En frfrgan om att terstlla lsenordet fr det hr konto har gjorts och drfr fr du det hr e-postmeddelandet <strong><<user>></strong>.\r\n</p>\r\n<p>\r\nYou can now create your new password using the following link:\r\n<br/><a href=\"<<passwordreseturl>>\"><<passwordreseturl>></a>\r\n</p>\r\n<p>This link will be valid for 2 days from this email\'s reception, then you must reapply if you do not change your password.</p>\r\n<p>Thank you.</p>\r\n</html>\r\n','email','default','2022-08-30 15:08:00'),(42,'members','STAFF_PASSWORD_RESET','','Online password reset',1,'Koha password reset','<html>\r\n<p>A librarian has reset the password for the account <strong><<user>></strong>.\r\n</p>\r\n<p>\r\nPlease create your new password using the following link:\r\n<br/><a href=\"<<passwordreseturl>>\"><<passwordreseturl>></a>\r\n</p>\r\n<p>This link will be valid for 5 days from this email\'s reception, then you must reapply if you do not change your password.</p>\r\n<p>Thank you.</p>\r\n</html>\r\n','email','default','2022-08-30 15:08:00'),(43,'members','SHARE_ACCEPT','','Notification about an accepted share',0,'Share on list <<listname>> accepted','Dear patron,\r\n\r\nWe want to inform you that <<borrowers.firstname>> <<borrowers.surname>> accepted your invitation to share your list <<listname>> in our library catalog.\r\n\r\nThank you.\r\n\r\nYour library.','email','default','2022-08-30 15:08:00'),(44,'members','SHARE_INVITE','','Invitation for sharing a list',0,'Share list <<listname>>','Dear patron,\r\n\r\nOne of our patrons, <<borrowers.firstname>> <<borrowers.surname>>, invites you to share a list <<listname>> in our library catalog.\r\n\r\nTo access this shared list, please click on the following URL or copy-and-paste it into your browser address bar.\r\n\r\n<<shareurl>>\r\n\r\nIn case you are not a patron in our library or do not want to accept this invitation, please ignore this mail. Note also that this invitation expires within two weeks.\r\n\r\nThank you.\r\n\r\nYour library.','email','default','2022-08-30 15:08:00'),(45,'members','WELCOME','','Welcome notice ',1,'[% USE Koha %][% IF Koha.Preference(\'LibraryName\') %]Welcome to [% Koha.Preference(\'LibraryName\') %][% ELSE %]Welcome to the library[% END %]','[% USE Koha %]\r\nHej [% borrower.title %] [% borrower.firstname %] [% borrower.surname %].\r\n\r\nThank you for joining [% IF Koha.Preference(\'LibraryName\') %][% Koha.Preference(\'LibraryName\') %][% ELSE %]the library[% END %]\r\n\r\nYou can search for all our materials in our <a href=\'[% Koha.Preference(\'OPACBaseURL\') %]\'>catalog</a>.\r\n\r\nDitt kortnummer r [% borrower.cardnumber %]\r\n\r\nOm du har ngra problem eller frgor om ditt konto, kontakta biblioteket.','email','default','2022-08-30 15:08:00'),(46,'orderacquisition','ACQORDER','','Acquisition order',0,'Bestllning','<<aqbooksellers.name>>\r\n<<aqbooksellers.address1>>\r\n<<aqbooksellers.address2>>\r\n<<aqbooksellers.address3>>\r\n<<aqbooksellers.address4>>\r\n<<aqbooksellers.phone>>\r\n\r\nPlease order for the library:\r\n\r\n<order>Ordernumber <<aqorders.ordernumber>> (<<biblio.title>>) (quantity: <<aqorders.quantity>>) ($<<aqorders.listprice>> each).</order>\r\n\r\nThank you,\r\n\r\n<<branches.branchname>>','email','default','2022-08-30 15:08:00'),(47,'pos','RECEIPT','','Point of sale receipt',1,'Receipt','[% USE KohaDates %]\r\n[% USE Branches %]\r\n[% USE Price %]\r\n[% PROCESS \"accounts.inc\" %]\r\n<table>\r\n[% IF ( LibraryName ) %]\r\n <tr>\r\n    <th colspan=\"2\" class=\"centerednames\">\r\n        <h3>[% LibraryName | html %]</h3>\r\n    </th>\r\n </tr>\r\n[% END %]\r\n <tr>\r\n    <th colspan=\"2\" class=\"centerednames\">\r\n        <h2>[% Branches.GetName( credit.branchcode ) | html %]</h2>\r\n    </th>\r\n </tr>\r\n<tr>\r\n    <th colspan=\"2\" class=\"centerednames\">\r\n        <h3>[% credit.date | $KohaDates %]</h3>\r\n</tr>\r\n<tr>\r\n  <td>Transaction ID: </td>\r\n  <td>[% credit.accountlines_id %]</td>\r\n</tr>\r\n<tr>\r\n  <td>Operator ID: </td>\r\n  <td>[% credit.manager_id %]</td>\r\n</tr>\r\n<tr>\r\n  <td>Payment type: </td>\r\n  <td>[% credit.payment_type %]</td>\r\n</tr>\r\n <tr></tr>\r\n <tr>\r\n    <th colspan=\"2\" class=\"centerednames\">\r\n        <h2><u>Fee receipt</u></h2>\r\n    </th>\r\n </tr>\r\n <tr></tr>\r\n <tr>\r\n    <th>Description of charges</th>\r\n    <th>Amount</th>\r\n  </tr>\r\n\r\n  [% FOREACH debit IN credit.debits %]\r\n    <tr>\r\n        <td>[% PROCESS account_type_description account=debit %]</td>\r\n        <td>[% debit.amount * -1 | $Price %]</td>\r\n    </tr>\r\n  [% END %]\r\n\r\n<tfoot>\r\n  <tr class=\"highlight\">\r\n    <td>Total: </td>\r\n    <td>[% credit.amount * -1| $Price %]</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Tendered: </td>\r\n    <td>[% collected | $Price %]</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Change: </td>\r\n    <td>[% change | $Price %]</td>\r\n    </tr>\r\n</tfoot>\r\n</table>','print','default','2022-08-30 15:08:00'),(48,'reserves','CANCEL_HOLD_ON_LOST','','Hold has been cancelled',0,'Hold has been cancelled','Dear [% borrower.firstname %] [% borrower.surname %],\r\n\r\nWe regret to inform you, that the following item can not be provided due to it being missing. Your hold was cancelled.\r\n\r\nTitel: [% biblio.title %]\r\nFrfattare: [% biblio.author %]\r\nCopy: [% item.copynumber %]\r\nPlats: [% branch.branchname %]','email','default','2022-08-30 15:08:00'),(49,'reserves','HOLD','','Hold available for pickup',0,'Hold available for pickup at <<branches.branchname>>','Dear <<borrowers.firstname>> <<borrowers.surname>>,\r\n\r\nYou have a hold available for pickup as of <<reserves.waitingdate>>:\r\n\r\nTitel: <<biblio.title>>\r\nFrfattare: <<biblio.author>>\r\nCopy: <<items.copynumber>>\r\nPlats: <<branches.branchname>>\r\n<<branches.branchaddress1>>\r\n<<branches.branchaddress2>>\r\n<<branches.branchaddress3>>\r\n<<branches.branchcity>> <<branches.branchzip>>','email','default','2022-08-30 15:08:00'),(50,'reserves','HOLD','','Hold available for pickup',0,'Hold available for pickup (print notice)','<<branches.branchname>>\r\n<<branches.branchaddress1>>\r\n<<branches.branchaddress2>>\r\n\r\n\r\nChange service requested\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<<borrowers.firstname>> <<borrowers.surname>>\r\n<<borrowers.address>>\r\n<<borrowers.city>> <<borrowers.zipcode>>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<<borrowers.firstname>> <<borrowers.surname>> <<borrowers.cardnumber>>\r\n\r\nYou have a hold available for pickup as of <<reserves.waitingdate>>:\r\n\r\nTitel: <<biblio.title>>\r\nFrfattare: <<biblio.author>>\r\nCopy: <<items.copynumber>>\r\n','print','default','2022-08-30 15:08:00'),(51,'reserves','HOLDPLACED','','Hold placed on item',0,'Hold placed on item','A hold has been placed on the following item : <<biblio.title>> (<<biblio.biblionumber>>) by the user <<borrowers.firstname>> <<borrowers.surname>> (<<borrowers.cardnumber>>).','email','default','2022-08-30 15:08:00'),(52,'reserves','HOLD_REMINDER','','Waiting hold reminder',0,'You have waiting holds.','Dear [% borrower.firstname %] [% borrower.surname %],\n\nThe following holds are waiting at [% branch.branchname %]:\n\n[% FOREACH hold IN holds %]\n    [% hold.biblio.title %] : waiting since [% hold.waitingdate | $KohaDates %]\n[% END %]','email','default','2022-08-30 15:08:00'),(53,'serial','SERIAL_ALERT','','New serial issue',0,'New serial issue is now available','<<borrowers.firstname>> <<borrowers.surname>>,\r\n\r\nThe following issue is now available:\r\n\r\n<<biblio.title>>, <<biblio.author>> (<<items.barcode>>)\r\n\r\nPlease pick it up at your convenience.','email','default','2022-08-30 15:08:00'),(54,'suggestions','ACCEPTED','','Frslag godknt',0,'Purchase suggestion accepted','Dear <<borrowers.firstname>> <<borrowers.surname>>,\r\n\r\nYou have suggested that the library acquire <<suggestions.title>> by <<suggestions.author>>.\r\n\r\nThe library has reviewed your suggestion today. The item will be ordered as soon as possible. You will be notified by mail when the order is completed, and again when the item arrives at the library.\r\n\r\nIf you have any questions, please email us at <<branches.branchemail>>.\r\n\r\nThank you,\r\n\r\n<<branches.branchname>>','email','default','2022-08-30 15:08:00'),(55,'suggestions','AVAILABLE','','Suggestion available',0,'Suggested purchase available','Dear <<borrowers.firstname>> <<borrowers.surname>>,\r\n\r\nYou have suggested that the library acquire <<suggestions.title>> by <<suggestions.author>>.\r\n\r\nWe are pleased to inform you that the item you requested is now part of the collection.\r\n\r\nIf you have any questions, please email us at <<branches.branchemail>>.\r\n\r\nThank you,\r\n\r\n<<branches.branchname>>','email','default','2022-08-30 15:08:00'),(56,'suggestions','NEW_SUGGESTION','','New suggestion',1,'New suggestion','<h3>Suggestion pending approval</h3>\r\n    <p><h4>Suggested by</h4>\r\n    <ul>\r\n    <li><<borrowers.firstname>> <<borrowers.surname>></li>\r\n    <li><<borrowers.cardnumber>></li>\r\n    <li><<borrowers.phone>></li>\r\n    <li><<borrowers.email>></li>\r\n    </ul>\r\n    </p>\r\n    <p><h4>Title suggested</h4>\r\n    <ul>\r\n    <li><b>Library:</b> <<branches.branchname>></li>\r\n    <li><b>Title:</b> <<suggestions.title>></li>\r\n    <li><b>Author:</b> <<suggestions.author>></li>\r\n    <li><b>Copyright date:</b> <<suggestions.copyrightdate>></li>\r\n    <li><b>Standard number (ISBN, ISSN or other):</b> <<suggestions.isbn>></li>\r\n    <li><b>Publisher:</b> <<suggestions.publishercode>></li>\r\n    <li><b>Collection title:</b> <<suggestions.collectiontitle>></li>\r\n    <li><b>Publication place:</b> <<suggestions.place>></li>\r\n    <li><b>Quantity:</b> <<suggestions.quantity>></li>\r\n    <li><b>Item type:</b>  <<suggestions.itemtype>></li>\r\n    <li><b>Reason for suggestion:</b> <<suggestions.patronreason>></li>\r\n    <li><b>Notes:</b> <<suggestions.note>></li>\r\n    </ul>\r\n    </p>','email','default','2022-08-30 15:08:00'),(57,'suggestions','ORDERED','','Suggestion ordered',0,'Suggested item ordered','Dear <<borrowers.firstname>> <<borrowers.surname>>,\r\n\r\nYou have suggested that the library acquire <<suggestions.title>> by <<suggestions.author>>.\r\n\r\nWe are pleased to inform you that the item you requested has now been ordered. It should arrive soon, at which time it will be processed for addition into the collection.\r\n\r\nYou will be notified again when the book is available.\r\n\r\nIf you have any questions, please email us at <<branches.branchemail>>\r\n\r\nThank you,\r\n\r\n<<branches.branchname>>','email','default','2022-08-30 15:08:00'),(58,'suggestions','REJECTED','','Suggestion rejected',0,'Purchase suggestion declined','Dear <<borrowers.firstname>> <<borrowers.surname>>,\r\n\r\nYou have suggested that the library acquire <<suggestions.title>> by <<suggestions.author>>.\r\n\r\nThe library has reviewed your request today, and has decided not to accept the suggestion at this time.\r\n\r\nDen angivna orsaken r: <<suggestions.reason>>\r\n\r\nIf you have any questions, please email us at <<branches.branchemail>>.\r\n\r\nThank you,\r\n\r\n<<branches.branchname>>','email','default','2022-08-30 15:08:00'),(59,'suggestions','TO_PROCESS','','Notify fund owner',0,'A suggestion is ready to be processed','Dear <<borrowers.firstname>> <<borrowers.surname>>,\r\n\r\nA new suggestion is ready to be processed: <<suggestions.title>> by <<suggestions.author>>.\r\n\r\nThank you,\r\n\r\n<<branches.branchname>>','email','default','2022-08-30 15:08:00'),(60,'suggestions','NOTIFY_MANAGER','','Notify manager of a suggestion',0,'A suggestion has been assigned to you','Dear [% borrower.firstname %] [% borrower.surname %],\r\n\r\nA new suggestion has been assigned to you: [% suggestion.title %].\r\n\r\nThank you,\r\n\r\n[% branch.branchname %]','email','default','2022-08-30 15:08:00'),(61,'members','PROBLEM_REPORT','','OPAC problem report',0,'OPAC problem report','Anvndarnamn: <<problem_reports.username>>\r\n\r\nProblem page: <<problem_reports.problempage>>\r\n\r\nTitel: <<problem_reports.title>>\r\n\r\nMeddelande: <<problem_reports.content>>','email','default','2022-08-30 15:08:00'),(62,'circulation','AUTO_RENEWALS','','Notification of automatic renewal',0,'Automatic renewal notice','Dear [% borrower.firstname %] [% borrower.surname %],\r\n[% IF checkout.auto_renew_error %]\r\nExemplaret [% biblio.title %] har inte blivit omlnat eftersom:\r\n[% IF checkout.auto_renew_error == \'too_many\' %]\r\nYou have reached the maximum number of renewals possible.\r\n[% ELSIF checkout.auto_renew_error == \'on_reserve\' %]\r\nExemplaret r reserverat fr en annan lntagare.\r\n[% ELSIF checkout.auto_renew_error == \'restriction\' %]\r\nYou are currently restricted.\r\n[% ELSIF checkout.auto_renew_error == \'overdue\' %]\r\nDu har frsenade ln.\r\n[% ELSIF checkout.auto_renew_error == \'auto_too_late\' %]\r\nIt\'s too late to renew this item.\r\n[% ELSIF checkout.auto_renew_error == \'auto_too_much_oweing\' %]\r\nDu har fr hga obetalda avgifter totalt.\r\n[% ELSIF checkout.auto_renew_error == \'too_unseen\' %]\r\nDetta exemplar mste lnas om p biblioteket.\r\n[% ELSIF checkout.auto_renew_error == \'auto_account_expired\' %]\r\nKontot r inte lngre giltigt.\r\n[% END %]\r\n[% ELSE %]\r\nExemplaret [% biblio.title %] har blivit omlnat och har ftt terlmningsdatum [% checkout.date_due | $KohaDates as_due_date => 1 %]\r\n[% END %]','email','default','2022-08-30 15:08:00'),(63,'circulation','CHECKINSLIP','','terlmningskvitto',1,'terlmningskvitto','<h3>[% branch.branchname %]</h3>\r\nChecked in items for [% borrower.title %] [% borrower.firstname %] [% borrower.initials %] [% borrower.surname %] <br />\r\n([% borrower.cardnumber %]) <br />\r\n\r\n[% today | $KohaDates %]<br />\r\n\r\n<h4>Checked in today</h4>\r\n[% FOREACH checkin IN old_checkouts %]\r\n[% SET item = checkin.item %]\r\n<p>\r\n[% item.biblio.title %] <br />\r\nStreckkod: [% item.barcode %] <br />\r\n</p>\r\n[% END %]','print','default','2022-08-30 15:08:00'),(64,'circulation','AUTO_RENEWALS_DGST','','Notification on auto renewals',0,'Automatiskt omln (Frkortat)','Dear [% borrower.firstname %] [% borrower.surname %],\r\n[% IF error %]\r\nThere were [% error %] items that were not renewed.\r\n[% END %]\r\n[% IF success %]\r\nThere were [% success %] items that were renewed.\r\n[% END %]\r\n[% FOREACH checkout IN checkouts %]\r\n[% checkout.item.biblio.title %] : [% checkout.item.barcode %]\r\n[% IF !checkout.auto_renew_error %]\r\nwas renewed until [% checkout.date_due | $KohaDates as_due_date => 1%]\r\n[% ELSIF checkout.auto_renew_error == \'too_many\' %]\r\nYou have reached the maximum number of renewals possible.\r\n[% ELSIF checkout.auto_renew_error == \'on_reserve\' %]\r\nExemplaret r reserverat fr en annan lntagare.\r\n[% ELSIF checkout.auto_renew_error == \'restriction\' %]\r\nYou are currently restricted.\r\n[% ELSIF checkout.auto_renew_error == \'overdue\' %]\r\nDu har frsenade ln.\r\n[% ELSIF checkout.auto_renew_error == \'auto_too_late\' %]\r\nIt\'s too late to renew this item.\r\n[% ELSIF checkout.auto_renew_error == \'auto_too_much_oweing\' %]\r\nDu har fr hga obetalda avgifter totalt.\r\n[% ELSIF checkout.auto_renew_error == \'too_unseen\' %]\r\nDetta exemplar mste lnas om p biblioteket.\r\n[% END %]\r\n[% END %]','email','default','2022-08-30 15:08:00'),(65,'circulation','RETURN_RECALLED_ITEM','','Notification to return a recalled item',0,'Notification to return a recalled item','Datum: <<today>>\r\n\r\n<<borrowers.firstname>> <<borrowers.surname>>,\r\n\r\nA recall has been placed on the following item: <<biblio.title>> / <<biblio.author>> (<<items.barcode>>). The due date has been updated, and is now <<issues.date_due>>. Please return the item before the due date.\r\n\r\nTack! ','email','default','2022-08-30 15:08:00'),(66,'circulation','PICKUP_RECALLED_ITEM','','Recalled item awaiting pickup',0,'Recalled item awaiting pickup','Datum: <<today>>\r\n\r\n<<borrowers.firstname>> <<borrowers.surname>>,\r\n\r\nA recall that you requested on the following item: <<biblio.title>> / <<biblio.author>> (<<items.barcode>>) is now ready for you to pick up at <<recalls.branchcode>>. Please pick up your item by <<recalls.expirationdate>>.\r\n\r\nTack! ','email','default','2022-08-30 15:08:00'),(67,'circulation','RECALL_REQUESTER_DET','','Details of patron who recalled item',0,'Details of patron who recalled item','Datum: <<today>>\r\n\r\nRecall for pickup at <<branches.branchname>>\r\n<<borrowers.surname>>, <<borrowers.firstname>> (<<borrowers.cardnumber>>)\r\n<<borrowers.phone>>\r\n<<borrowers.streetnumber>> <<borrowers.address>>, <<borrowers.address2>>, <<borrowers.city>> <<borrowers.zipcode>>\r\n<<borrowers.email>>\r\n\r\nITEM RECALLED\r\n<<biblio.title>> by <<biblio.author>>\r\nStreckkod: <<items.barcode>>\r\nCallnumber: <<items.itemcallnumber>>\r\nVntar sedan: <<recalls.waitingdate>>\r\nKommentarer: <<recalls.recallnotes>>','print','default','2022-08-30 15:08:00'),(68,'members','2FA_DISABLE','','Confirmation of disabling two factor authentication',1,'Confirmation of disabling two factor authentication','<p>Dear [% borrower.firstname %] [% borrower.surname %],</p>\r\n<p>This is to confirm that someone disabled two factor authentication on your account.</p>\r\n<p>If you did not do this, someone else may be using your account. Please contact technical support.</p>\r\n<p>Your library</p>','email','default','2022-08-30 15:08:00'),(69,'members','2FA_ENABLE','','Confirmation of enabling two factor authentication',1,'Confirmation of enabling two factor authentication','<p>Dear [% borrower.firstname %] [% borrower.surname %],</p>\r\n<p>This is to confirm that someone enabled two factor authentication on your account.</p>\r\n<p>If you did not do this, someone else may be using your account. Please contact technical support.</p>\r\n<p>Your library</p>','email','default','2022-08-30 15:08:00');
